  \"2013-03-15T21:07:32.589000\",\n\t\"name\": \"county-based-estimates-of-nitrogen-and-phosphorus-content-of-animal-manure-in-the-united-s-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains county estimates
  of nitrogen and phosphorus content of animal wastes produced annually for the years
  1982, 1987, and 1992. The estimates are based on animal populations for those years
  from the 1992 Census of Agriculture (U.S. Bureau of the Census, 1995) and methods
  for estimating the nutrient content of manure from the Soil Conservation Service
  (1992). The data set includes several components.. 1. Spatial component - generalized
  county boundaries in ARC/INFO format/1/, including nine INFO lookup tables containing
  animal counts and nutrient estimates keyed to the county polygons using county code.
  (The county lines were not used in the nutrient computations and are provided for
  displaying the data as a courtesy to the user.) The data is organized by 5-digit
  state/county FIPS (Federal Information Processing Standards) code. Another INFO
  table lists the county names that correspond to the FIPS codes. 2. Tabular component
  - Nine tab-delimited ASCII lookup tables of animal counts and nutrient estimates
  organized by 5-digit state/county FIPS (Federal Information Processing Standards)
  code. Another table lists the county names that correspond to the FIPS codes. The
  use of trade names is for identification purposes only and does not constitute endorsement
  by the U.S. Geological Survey.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
